import Vue from 'vue'
import VueRouter from 'vue-router'
import ListPage from "@/components/children/ListPage";
import NewBook from "@/components/children/NewBook";
import HomePage from '@/components/children/HomePage'
// import TabHome from '@/components/children/TabHome'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomePage
  },
  {
    path: '/list-page',
    name: 'listPage',
    component: ListPage
  },
  {
    path: '/new-book',
    name: 'newBook',
    component: NewBook

  },
  // {
  //   path: '/tab-home',
  //   name: 'tabHome',
  //   component: TabHome
  // }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
